import React from 'react';
import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne } from './WorkTitle/Data'


function Joul() {
    const isBackgroundGreen = false;

    return (
        <>
        <div className={isBackgroundGreen ? 'background-green' : 'background-white'} />
            <WorkTitle {...WorkOne} />
        </>
    )
}

export default Joul;
